import Button from "@material-ui/core/Button"
import Grid from '@material-ui/core/Grid';
import Card from '@material-ui/core/Card';
import TextField from '@material-ui/core/TextField';
import Input from '@material-ui/core/Input';

import API_URL from '../../../Constants/backend_url.js'

export default class SearchContent extends Component {

  componentDidMount(){

    this.renderEstablishmentCards()

  }

  renderEstablishmentCards = () =>{
    header = ({"Content-Type": "application/json", "Authorization": `Bearer ${this.props.jwt}`})
    fetch(API_URL.establishments ,
      {method: "GET",
      headers: {"Content-Type": "application/json", "Authorization": `Bearer ${this.props.jwt}`},})
      .then(response => response.json())
      .then(info =>{
        console.log(info)
      })
  }

  render(){
    return(
      <Paper style={{minWidth:"90vh"}, {minHeight:"90vh"}} >
        <Grid container
          direction="column"
          alignItems="center"
          justify="center"
          spacing={24}
          style={{minWidth:"50vh"}, {minHeight:"50vh"}} >

          {}

        </Grid>
          Searching boyo
      </Paper>
    )
  }
}
